import { useState } from "react";
import { useNavigate } from "react-router-dom";

const Signup = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    fullName: "",
    email: "",
    password: "",
    country: "",
    profession: "",
    expertise: "",
    availability: "part-time",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Simulated storage
    const users = JSON.parse(localStorage.getItem("users")) || [];
    users.push({ ...formData, role: "user", verified: false });
    localStorage.setItem("users", JSON.stringify(users));

    alert("Registration submitted. Awaiting verification.");
    navigate("/login");
  };

  return (
    <div className="min-h-screen flex items-center justify-center px-4">
      <div className="bg-white/90 p-8 rounded-xl shadow-md w-full max-w-2xl">
        <h1 className="text-3xl font-bold text-primary mb-6 text-center">Sign Up</h1>
        <form onSubmit={handleSubmit} className="space-y-5">
          <div>
            <label className="label">Full Name</label>
            <input type="text" name="fullName" required value={formData.fullName} onChange={handleChange} className="input" />
          </div>
          <div>
            <label className="label">Email</label>
            <input type="email" name="email" required value={formData.email} onChange={handleChange} className="input" />
          </div>
          <div>
            <label className="label">Password</label>
            <input type="password" name="password" required value={formData.password} onChange={handleChange} className="input" />
          </div>
          <div>
            <label className="label">Country of Residence</label>
            <input type="text" name="country" required value={formData.country} onChange={handleChange} className="input" />
          </div>
          <div>
            <label className="label">Profession</label>
            <input type="text" name="profession" required value={formData.profession} onChange={handleChange} className="input" />
          </div>
          <div>
            <label className="label">Areas of Expertise</label>
            <textarea name="expertise" required value={formData.expertise} onChange={handleChange} className="textarea" />
          </div>
          <div>
            <label className="label">Availability</label>
            <select name="availability" value={formData.availability} onChange={handleChange} className="input">
              <option value="full-time">Full-time</option>
              <option value="part-time">Part-time</option>
              <option value="ad-hoc">Ad-hoc</option>
            </select>
          </div>
          <button type="submit" className="btn-primary w-full">Create Account</button>
        </form>
      </div>
    </div>
  );
};

export default Signup;
